import React from 'react'
import Gallary from './components/Gallary';
import App from './components/App';
import Jsx from './components/Jsx';
import Class from './components/Class';
import Gellary from './components/Gellary';
import Cent from './components/Cent';


const App2 = () => {
  return (
    <>
   <h2 style={{backgroundColor:"red",display:"flex" ,alignItem:"center",alignContent:"center",justifyContent:"center"}}> Components</h2>
    <App/>
    <Cent/>
    <Class/>
    <Gallary/>
    <Gellary/>
    <Jsx/>
    </>
  )
}

export default App2
